import React from 'react';
import { Routes, Route, Link } from 'react-router-dom'; // Debe estar importado
import './App.css'; 
import TodoList from './components/TodoList'; 
import Login from './components/Login';       

function App() {
  return (
    <div className="App">
      {/* ðŸŽ¯ PRUEBA: Usa este Link para navegar, NO escribas en la URL */}
      <nav style={{ marginBottom: '20px' }}>
        <Link to="/">[Ver Agenda]</Link> | <Link to="/login">[Ver Login]</Link>
      </nav>
      
      <Routes>
        <Route path="/" element={<TodoList />} /> 
        <Route path="/login" element={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
